import { Card, CardHeader, CardBody, Heading, Grid, Text } from '@chakra-ui/react';

function Result({ results }) {
    return (
        <Grid mt={15} templateColumns='repeat(3, 1fr)' gap={8}>
            {results &&
                Object.entries(results).map(([task, result], index) => (
                    <Card key={index}>
                        <CardHeader>
                            <Heading size='md'>{`${task} Diagnosis Result`}</Heading>
                        </CardHeader>
                        <CardBody>
                            <Text>{result}</Text>
                            {/* You can customize how the result is displayed based on your actual result structure */}
                        </CardBody>
                    </Card>
                ))}
        </Grid>
    );
}

export default Result;
